import React from 'react';
import { Carousel } from 'react-bootstrap';
import image1 from './Images/image1.jpg';
import image2 from './Images/image2.jpg';
import image3 from './Images/image3.jpg';
import image4 from './Images/image4.jpg';
import './LocalDetails.css'; // Import your CSS file for styling

class LocalDetails extends React.Component {
    render() {
        // Array of image URLs for the gallery
        const images = [image1, image2, image3, image4];

        return (
            <div>
                <div className="title-container">
                    <h1 className="title">Logement entier : h√©bergement - Larbaa Beni Hassen, Maroc</h1>

                </div>
                <h6>6 voyageurs 3 chambres 5 lits</h6>
                <h6>5 lits</h6>
                <h6>2 salles de bain</h6>
                <div className="carousel-wrapper">
                    <div className="carousel-container">
                        <Carousel>
                            {images.map((image, index) => (
                                <Carousel.Item key={index}>
                                    <img
                                        className="d-block w-100 rounded-carousel-image"
                                        src={image}
                                        alt=""
                                    />
                                </Carousel.Item>
                            ))}
                        </Carousel>
                    </div>
                    <div className="info-container">

                    </div>
                </div>
            </div>
        );

    }
}

export default LocalDetails;
